import Button from "../Button";

const LoginMain = ({onChange}) => {
    const emailLoginHandler = () => {
        onChange();
    }

    return (
        <div className="LoginMain">
            LoginMain
            <Button text="button" onClick={emailLoginHandler}/>            
        </div>
    );
}

export default LoginMain;
